import Head from 'next/head'

function Layout (props) {
  return(
    <div>
    <Head>
      <title>This is the title</title>
      <link rel="stylesheet" href="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
    </Head>
      {props.children}
    </div>
  )
}

export default Layout
